unitsize(0.3cm);
draw((0,0)--(4.5,6)--(21,0)--cycle);
draw((3,0)--(3,4)--(10,4)--(10,0)--cycle);
label("B",(0,0),SW);
label("W",(3,4),W);
label("A",(4.5,6),N);
label("X",(10,4),NE);
label("C",(21,0),E);
label("Y",(10,0),S);
label("Z",(3,0),S);
label(scale(0.7)*Label("$26^{\circ}$",(2.4,2.6),S));
